constexpr size_t max_int_bits = 16;
constexpr size_t max_int_part = 1ULL << max_int_bits;
constexpr size_t max_target = max_int_part << 6;
// the next line **should** be constexpr; alas, it cannot be until C++20 :(
const size_t loop_bound = std::lower_bound(std::begin(bounds), std::end(bounds), max_target) - bounds;

inline constexpr uint64_t mod(uint64_t x, uint32_t n) { return ((x%n)+n)%n; }
static auto isqrt_coeffs(const uint64_t * query, uint32_t offset)
{
	long double M = 0.0L, B = 0.0L;
	size_t count = 0;
 
	for (int i = 0; i < loop_bound; ++i)
	{
		int from_word = mod(bounds[i+0] - offset, max_target) / 64;
		int from_bit  = mod(bounds[i+0] - offset, max_target) % 64;

		uint64_t from_mask = ~((1ULL << from_bit)-1);

		int to_word = mod(bounds[i+1] - offset, max_target) / 64;
		int to_bit  = mod(bounds[i+1] - offset, max_target) % 64;
		uint64_t to_mask = ~((1ULL << to_bit)-1);

		int span = mod(to_word - from_word, max_int_part);
		uint64_t tmp = query[from_word] & from_mask;
		for (int j = 1; j <= span; ++j) tmp ^= query[mod(from_word+j, max_int_part)];
		tmp ^= query[to_word] & to_mask;

		auto parity = __builtin_parityll(tmp);

		M += parity * m[i];
		B += parity * b[i];
 
		count += parity;
	}

	return std::make_tuple(M, B, count);
}
 




